package org.apache.commons.vfs2.filter;

import org.apache.commons.vfs2.FileObject;
import org.apache.commons.vfs2.FileSelectInfo;
import org.apache.commons.vfs2.provider.DefaultFileSelectorInfo;
import org.junit.Assert;
import org.junit.Test;

import java.util.Arrays;
import java.util.List;

public class NameFileFilterTest1 {

    private FileSelectInfo wrapFilename(String filename) throws Exception {
        DefaultFileSelectorInfo fileSelectorInfo = new DefaultFileSelectorInfo();
        FileObject fileObject = new org.apache.commons.vfs2.impl.DefaultFileSystemManager().resolveFile("file:///" + filename);
        fileSelectorInfo.setFile(fileObject);
        return fileSelectorInfo;
    }

    @Test
    public void testNameFileFilterAcceptsExactMatches() throws Exception {
        // Step 0: Initialize a collection of filename strings with two distinct valid target names
        List<String> filenameCollection = Arrays.asList("file1.txt", "file2.txt");

        // Step 1: Construct a NameFileFilter instance using the filename collection
        NameFileFilter filterInstance = new NameFileFilter(filenameCollection);

        // Step 2: Wrap the first filename into a DefaultFileSelectorInfo structure
        FileSelectInfo fileSelectionInfo1 = wrapFilename(filenameCollection.get(0));

        // Step 3: Assert that the filter accepts the first filename
        Assert.assertTrue("Filter should accept the first filename", filterInstance.accept(fileSelectionInfo1));

        // Step 4: Wrap the second filename into a DefaultFileSelectorInfo structure
        FileSelectInfo fileSelectionInfo2 = wrapFilename(filenameCollection.get(1));

        // Step 5: Assert that the filter accepts the second filename
        Assert.assertTrue("Filter should accept the second filename", filterInstance.accept(fileSelectionInfo2));

        // Step 6: Wrap the second filename with altered casing into a DefaultFileSelectorInfo structure
        String alteredCasingFilename = "FILE2.TXT";
        FileSelectInfo fileSelectionInfo3 = wrapFilename(alteredCasingFilename);

        // Step 7: Assert that the filter rejects the altered casing filename
        Assert.assertFalse("Filter should reject the altered casing filename", filterInstance.accept(fileSelectionInfo3));

        // Step 8: Wrap a non-listed filename into a DefaultFileSelectorInfo structure
        String nonListedFilename = "file3.txt";
        FileSelectInfo fileSelectionInfo4 = wrapFilename(nonListedFilename);

        // Step 9: Assert that the filter rejects the non-listed filename
        Assert.assertFalse("Filter should reject the non-listed filename", filterInstance.accept(fileSelectionInfo4));
    }
}

