        } catch (org.apache.commons.vfs2.FileSystemException e) {
            Assertions.fail("Failed to create file for testing: " + e.getMessage());
        }

        // Step 3: Verify the system accepts the file name by passing the FileSelectInfo object to the accept method
        boolean matchResultDifferentCase = filter.accept(fileSelectInfoDifferentCase);

        // Step 4: Verify the system accepts the file name
        Assertions.assertTrue(matchResultDifferentCase);

        // Step 5: Create a FileSelectInfo object with a completely uppercase variant of an approved name
        DefaultFileSelectorInfo fileSelectInfoUppercase = new DefaultFileSelectorInfo();
        try {
            fileSelectInfoUppercase.setFile(new org.apache.commons.vfs2.impl.DefaultFileSystemManager().resolveFile("FILE1.TXT"));
        } catch (org.apache.commons.vfs2.FileSystemException e) {
            Assertions.fail("Failed to create file for testing: " + e.getMessage());
        }

        // Step 6: Verify the system accepts the file name by passing the FileSelectInfo object to the accept method
        boolean matchResultUppercase = filter.accept(fileSelectInfoUppercase);

        // Step 7: Verify the system accepts the file name
        Assertions.assertTrue(matchResultUppercase);

        // Step 8: Create a FileSelectInfo object with a mixed-case variant of an approved name
        DefaultFileSelectorInfo fileSelectInfoMixedCase = new DefaultFileSelectorInfo();
        try {
            fileSelectInfoMixedCase.setFile(new org.apache.commons.vfs2.impl.DefaultFileSystemManager().resolveFile("File2.Txt"));
        } catch (org.apache.commons.vfs2.FileSystemException e) {
            Assertions.fail("Failed to create file for testing: " + e.getMessage());
        }

        // Step 9: Verify the system accepts the file name by passing the FileSelectInfo object to the accept method
        boolean matchResultMixedCase = filter.accept(fileSelectInfoMixedCase);

        // Step 10: Verify the system accepts the file name
        Assertions.assertTrue(matchResultMixedCase);

        // Step 11: Create a FileSelectInfo object with a file name that does not appear in the approval list
        DefaultFileSelectorInfo fileSelectInfoUnapproved = new DefaultFileSelectorInfo();
        try {
            fileSelectInfoUnapproved.setFile(new org.apache.commons.vfs2.impl.DefaultFileSystemManager().resolveFile("unapproved_file_name.txt"));
