import static org.junit.jupiter.api.Assertions.assertTrue;

public class NameFileFilterTest1 {

    @Nested
    class CaseInsensitiveFilterTest {

        @Test
        void testCaseInsensitiveFileNameFiltering() {
            // Step 0: prepare an empty list of strings
            List<String> list = new ArrayList<>();

            // Step 1: add string literal 'test1.txt' to the list
            list.add("test1.txt");

            // Step 2: add string literal 'test2.txt' to the list
            list.add("test2.txt");

            // Step 3: construct a case-insensitive file name filter using the list
            NameFileFilter filter = new NameFileFilter(IOCase.INSENSITIVE, list);

            // Step 4: invoke accept on the filter with a file select info for 'TEST1.txt'
            boolean result1 = filter.accept(createFileSelectInfo(new File("TEST1.txt")));

            // Step 5: assert the returned boolean is true
            assertTrue(result1);

            // Step 6: invoke accept on the filter with a file select info for 'test2.txt'
            boolean result2 = filter.accept(createFileSelectInfo(new File("test2.txt")));

            // Step 7: assert the returned boolean is true
            assertTrue(result2);

            // Step 8: invoke accept on the filter with a file select info for 'Test2.txt'
            boolean result3 = filter.accept(createFileSelectInfo(new File("Test2.txt")));

            // Step 9: assert the returned boolean is true
            assertTrue(result3);

            // Step 10: invoke accept on the filter with a file select info for 'test.xxx'
            boolean result4 = filter.accept(createFileSelectInfo(new File("test.xxx")));

            // Step 11: assert the returned boolean is false
            assertFalse(result4);
        }

        private FileSelectInfo createFileSelectInfo(File file) {
            try {
                FileSystemManager fileSystemManager = VFS.getManager();
                FileObject fileObject = fileSystemManager.resolveFile("file://" + file.getAbsolutePath());
                return new DefaultFileSelectorInfo(fileObject);
            } catch (Exception e) {
                throw new RuntimeException("Failed to create FileSelectInfo", e);
            }
        }
    }
}

package org.apache.commons.vfs2.filter;

import org.junit.Assert;
import org.junit.Test;
import java.util.ArrayList;
