public class NameFileFilterTest1 {

    @Test
    public void testCaseInsensitiveFileNameFiltering() {
        // Step 0: Initialize an empty list collection
        List<String> empty_list = new ArrayList<>();

        // Step 1: Populate the list with two filename strings
        List<String> filename_list = new ArrayList<>();
        filename_list.add("file1.txt");
        filename_list.add("file2.txt");

        // Step 2: Construct a Name File Filter with case-insensitive comparison mode and the prepared list of names
        String[] names = filename_list.toArray(new String[0]);
        NameFileFilter filter = new NameFileFilter(names, false);

        // Step 3: Create a helper method to wrap file path strings into file selection information objects
        FileSelectInfo helper_method(String filePath) {
            return new FileSelectInfo() {
                private final String path = filePath;

                @Override
                public FileInfo getFile() {
                    return new FileInfo() {
                        @Override
                        public String getName() {
                            return path;
                        }
                    };
                }
            };
        }

        // Step 4: Invoke the filter's accept method with a file selection object representing the first list entry in uppercase
        FileSelectInfo fileSelectInfo1 = helper_method("FILE1.TXT");
        boolean accept_result_1 = filter.accept(fileSelectInfo1);

        // Step 5: Assert that the filter accepts the file selection object
        Assert.assertTrue("Filter should accept FILE1.TXT", accept_result_1);

        // Step 6: Invoke the filter's accept method with a file selection object representing the second list entry in its original lowercase form
        FileSelectInfo fileSelectInfo2 = helper_method("file2.txt");
        boolean accept_result_2 = filter.accept(fileSelectInfo2);

        // Step 7: Assert that the filter accepts the file selection object
        Assert.assertTrue("Filter should accept file2.txt", accept_result_2);

        // Step 8: Invoke the filter's accept method with a file selection object representing the second list entry in mixed case
        FileSelectInfo fileSelectInfo3 = helper_method("FiLe2.TxT");
        boolean accept_result_3 = filter.accept(fileSelectInfo3);

        // Step 9: Assert that the filter accepts the file selection object
        Assert.assertTrue("Filter should accept FiLe2.TxT", accept_result_3);

        // Step 10: Invoke the filter's accept method with a file selection object representing a filename not present in the configured list
        FileSelectInfo fileSelectInfo4 = helper_method("unknown.txt");
        boolean accept_result_4 = filter.accept(fileSelectInfo4);

        // Step 11: Assert that the filter rejects the file selection object
        Assert.assertFalse("Filter should reject unknown.txt", accept_result_4);
    }
}

package org.apache.commons.vfs2.filter;

import org.apache.commons.vfs2.FileName;
