import org.junit.jupiter.api.Test;
import org.mockito.Mockito;

import java.util.Arrays;
import java.util.List;

import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;

public class NameFileFilterTest1 {

    @Test
    public void testCaseSensitiveFilenameMatching() throws Exception {
        // Step 1: Construct a list containing two filename strings
        List<String> filenameList = Arrays.asList("file1.txt", "File2.TXT");

        // Step 2: Instantiate the Name File Filter with case-sensitive mode enabled and the prepared list of filenames
        NameFileFilter filter = new NameFileFilter(IOCase.SENSITIVE, filenameList);

        // Step 4: Address NullPointerException by ensuring FileObject.getName() returns a valid FileName object
        FileObject mockFileObject = Mockito.mock(FileObject.class);
        FileName mockFileName = Mockito.mock(FileName.class);
        Mockito.when(mockFileObject.getName()).thenReturn(mockFileName);

        // Create a mock FileSelectInfo
        FileSelectInfo mockFileSelectInfo = Mockito.mock(FileSelectInfo.class);
        Mockito.when(mockFileSelectInfo.getFile()).thenReturn(mockFileObject);

        // Step 5: Invoke the filter's accept method with a file selection object representing an uppercase variant of the first filename
        Mockito.when(mockFileName.getBaseName()).thenReturn("FILE1");
        Mockito.when(mockFileName.getExtension()).thenReturn("TXT");
        Mockito.when(mockFileName.getPath()).thenReturn("FILE1.TXT");
        boolean uppercaseVariantResult = filter.accept(mockFileSelectInfo);

        // Step 6: Verify the filter rejects it due to case mismatch
        assertFalse(uppercaseVariantResult);

        // Step 7: Invoke the accept method with a file selection object representing an exact match of the second filename
        Mockito.when(mockFileName.getBaseName()).thenReturn("File2");
        Mockito.when(mockFileName.getExtension()).thenReturn("TXT");
        Mockito.when(mockFileName.getPath()).thenReturn("File2.TXT");
        boolean exactMatchResult = filter.accept(mockFileSelectInfo);

        // Step 8: Confirm the filter accepts it
        assertTrue(exactMatchResult);

        // Step 9: Invoke the accept method with a file selection object representing a mixed-case variant of the second filename
        Mockito.when(mockFileName.getBaseName()).thenReturn("fIlE2");
        Mockito.when(mockFileName.getExtension()).thenReturn("tXt");
        Mockito.when(mockFileName.getPath()).thenReturn("fIlE2.tXt");
        boolean mixedCaseVariantResult = filter.accept(mockFileSelectInfo);

        // Step 10: Validate the filter rejects it, demonstrating strict case sensitivity
        assertFalse(mixedCaseVariantResult);

        // Step 11: Invoke the accept method with a file selection object representing a filename not present in the configured list
        Mockito.when(mockFileName.getBaseName()).thenReturn("Unknown");
        Mockito.when(mockFileName.getExtension()).thenReturn("txt");
        Mockito.when(mockFileName.getPath()).thenReturn("Unknown.txt");
        boolean unlistedFilenameResult = filter.accept(mockFileSelectInfo);

        // Step 12: Verify the filter rejects it regardless of case
        assertFalse(unlistedFilenameResult);
    }
}

