public class FtpFileSystemConfigBuilderTest1 {
    @Test
    public void testControlEncodingConfiguration() throws Exception {
        // Setup
        StandardFileSystemManager manager = new StandardFileSystemManager();
        manager.init();
        FileSystemConfigBuilder configBuilder = manager.getFileSystemConfigBuilder("ftp");
        FileSystemOptions fileSystemOptions = new FileSystemOptions();

        // Given: Select a standard character encoding format
        Charset standardEncodingFormat = StandardCharsets.UTF_8;

        // When: Configure the system using the encoding as a text name
        ((FtpFileSystemConfigBuilder) configBuilder).setControlEncoding(fileSystemOptions, "UTF-8");

        // Then: Verify the system correctly stores and retrieves the encoding
        Charset retrievedCharset = ((FtpFileSystemConfigBuilder) configBuilder).getControlEncodingCharset(fileSystemOptions);
        String retrievedEncoding = ((FtpFileSystemConfigBuilder) configBuilder).getControlEncoding(fileSystemOptions);

        // Ensure consistency between the two retrieval methods
        assertNotNull(retrievedCharset);
        assertNotNull(retrievedEncoding);
        assertEquals(standardEncodingFormat, retrievedCharset);
        assertEquals("UTF-8", retrievedEncoding);

        // When: Reconfigure the same setting using the encoding as a character set object
        ((FtpFileSystemConfigBuilder) configBuilder).setControlEncoding(fileSystemOptions, standardEncodingFormat);

        // Then: Confirm the system correctly stores and retrieves the encoding
        Charset retrievedCharsetAgain = ((FtpFileSystemConfigBuilder) configBuilder).getControlEncodingCharset(fileSystemOptions);
        String retrievedEncodingAgain = ((FtpFileSystemConfigBuilder) configBuilder).getControlEncoding(fileSystemOptions);

        // Demonstrate equivalence between the two input approaches
        assertNotNull(retrievedCharsetAgain);
        assertNotNull(retrievedEncodingAgain);
        assertEquals(standardEncodingFormat, retrievedCharsetAgain);
        assertEquals("UTF-8", retrievedEncodingAgain);

        // Verify the proper relationship between the character set object and its corresponding text name
        assertEquals(standardEncodingFormat, retrievedCharsetAgain);
        assertEquals("UTF-8", retrievedEncodingAgain);

        // Teardown
        manager.close();
    }
}

