public class FileSystemManagerTest {
    private DefaultFileSystemManager manager;
    private File tempDir;
    private boolean isSetUp;
    private FileObject readFolder;
    private FileObject writeFolder;
    private FileObject baseFolder;

    private static final String READ_TESTS_FOLDER = "read-tests";
    private static final String WRITE_TESTS_FOLDER = "write-tests";
    private static final String TEST_URI = "test.uri";

    @Test
    public void testFileSystemManager() throws Exception {
        setup();
        testFileResolution();
        teardown();
    }

    private void setup() throws Exception {
        if (isSetUp) {
            return;
        }
        isSetUp = true;

        tempDir = new File(System.getProperty("java.io.tmpdir"), "temp");
        tempDir.mkdirs();
        cleanDirectory(tempDir);
        checkTempDir("Temp dir not empty before test");

        manager = new DefaultFileSystemManager();

        DefaultFileReplicator replicator = new DefaultFileReplicator(tempDir);
        manager.setReplicator(new PrivilegedFileReplicator(replicator));
        manager.setTemporaryFileStore(replicator);

        if (!manager.hasProvider("file")) {
            manager.addProvider("file", new DefaultLocalFileProvider());
        }

        manager.init();

        baseFolder = resolveTestUri(manager);

        if (baseFolder != null) {
            readFolder = baseFolder.resolveFile(READ_TESTS_FOLDER);
            writeFolder = baseFolder.resolveFile(WRITE_TESTS_FOLDER);
        }

        Assertions.assertTrue(readFolder.exists(), "Folder does not exist: " + readFolder);
        Assertions.assertNotEquals(FileName.ROOT_PATH, readFolder.getName().getPath());
    }

    private void cleanDirectory(File directory) throws IOException {
        File[] files = directory.listFiles();
        if (files != null) {
            for (File file : files) {
                if (file.isDirectory()) {
                    cleanDirectory(file);
                }
                file.delete();
            }
        }
    }

    private void checkTempDir(String message) {
        if (tempDir.exists()) {
            Assertions.assertTrue(tempDir.isDirectory(), message + " (" + tempDir.getAbsolutePath() + ")");
            Assertions.assertTrue(tempDir.list().length == 0, message + " (" + tempDir.getAbsolutePath() + ")");
        }
