        FileObject nonExistentFile = readOnlyFolder.resolveFile("file-does-not-exist.txt", org.apache.commons.vfs2.NameScope.DESCENDENT);

        // Step 5: Obtain an input stream from the content of the non-existent file
        FileContent fileContent = nonExistentFile.getContent();

        // Step 6: Confirm system rejects the operation with a file system error
        Assertions.assertThrows(FileSystemException.class, () -> {
            InputStream stream = fileContent.getInputStream();
            stream.close();
